import React from "react";



const NavItem = ({ post_num, res}) => {

    console.log(res)

    return (
        <div id={'feed_element_container' + post_num} className="feed_element_container">
            <div className="feed_element_header">
                <p>Новость №{post_num+1}</p>
            </div>
            <div id={"feed_element_content"+post_num} className="feed_element_content">
                {res.map(e => (
                    <p>{e}</p>
                ))}
            </div>
        </div>
    )
}

export default NavItem;
